const maxProduct = function(nums) {
    let arr = nums.slice();
    for(let i=0;i<nums.length;i++){
        let num = i;
        for(let j=num+1;j<nums.length;j++){
            arr.push(nums.slice(i, j+1).reduce((a,b)=>a*b))
        }
    }
    return Math.max(...arr);
};

